package info.nukoneko.android.ho_n.sys.eventbus.event;import info.nukoneko.android.ho_n.sys.eventbus.NKEventTwitter;import twitter4j.User;import twitter4j.UserList;/** * Created by atsumi on 2016/10/22. */public class OnStreamUserListSubscription extends NKEventTwitter {    private final User subscriber;    private final User listOwner;    private final UserList list;    public OnStreamUserListSubscription(long managingUserId, User subscriber, User listOwner, UserList list) {        super(managingUserId);        this.subscriber = subscriber;        this.listOwner = listOwner;        this.list = list;    }    public User getListOwner() {        return listOwner;    }    public UserList getList() {        return list;    }    public User getSubscriber() {        return subscriber;    }}